// Category.js
import React from 'react';
import QuizCard from '../components/Quizcard';// If you have a setup supporting absolute imports
import './css/Category.css';                   // Same for CSS
               // Corrected import path for Category.css

               const Category = ({ title }) => {
                const quizData = {
                    "Ice Breaker": [
                        { title: "Getting to Know You", questions: 5, plays: "50k" },
                        { title: "Two Truths and a Lie", questions: 8, plays: "32k" },
                        { title: "Favorite Things", questions: 6, plays: "45k" },
                        { title: "Hobbies & Interests", questions: 10, plays: "20k" },
                        { title: "Would You Rather", questions: 7, plays: "28k" },
                    ],
                    "Math": [
                        { title: "Basic Arithmetic", questions: 10, plays: "120k" },
                        { title: "Algebra 101", questions: 12, plays: "95k" },
                        { title: "Geometry Fun", questions: 15, plays: "80k" },
                        { title: "Fractions & Decimals", questions: 10, plays: "60k" },
                        { title: "Word Problems", questions: 8, plays: "75k" },
                    ]
                };
            
                return (
                    <div className="category">
                        <h2>{title}</h2>
                        <div className="quiz-cards">
                            {quizData[title]?.map((quiz, index) => (
                                <QuizCard
                                    key={index}
                                    title={quiz.title}
                                    questions={quiz.questions}
                                    plays={quiz.plays}
                                />
                            ))}
                        </div>
                    </div>
                );
            };
            
            export default Category;
